import React from "react";

import { Container, Row, Col } from "reactstrap";
import productsImg from "../../assets/img/kx-hp-1_jicion.webp";
import CountUp from "react-countup";
import "./products.css";

export const Products = (props) =>  {
  return (
    <section>
      <Container>
        <Row>
          <Col lg="6" md="6">
            <div className="products__img">
              <img src={productsImg} alt="" className="w-100" />
            </div>
          </Col>

          <Col lg="6" md="6">
            <div className="products__content">
              <h3>Mangopulse CMS</h3>
              <p> <i className="fa fa-check-square"></i>Leverage out-of-the-box capabilities </p>
              <p> and a headless-ready platform that </p>
              <p>empowers marketers to execute campaigns</p>
              <p> at speed with no code/low code technology</p>
              
              <h4>Discover the capabilities of dxb <i className="fa fa-arrow-right" aria-hidden="true"></i></h4>
            </div>
          </Col>
        </Row>
      </Container>
    </section>
  );
};
